CREATE DATABASE `blogsys` CHARACTER SET utf8 COLLATE utf8_general_ci;

SET FOREIGN_KEY_CHECKS=0;

-- ----------------------------
-- Table structure for blog_articles
-- ----------------------------
DROP TABLE IF EXISTS `blog_articles`;
CREATE TABLE `blog_articles` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `title` varchar(32) DEFAULT NULL COMMENT '标题',
  `outline` varchar(2000) DEFAULT NULL COMMENT '概要',
  `cover_image` varchar(255) DEFAULT NULL COMMENT '封面图片',
  `content` text COMMENT '文章内容',
  `author` varchar(32) DEFAULT NULL COMMENT '文章作者',
  `category` varchar(32) DEFAULT NULL COMMENT '分类目录',
  `type` int(11) DEFAULT NULL COMMENT '文章类型 0-转载 1-原创 2-精贴',
  `tag` varchar(255) DEFAULT NULL COMMENT '文章标签(废弃,采用第三方表)',
  `hits_num` int(11) DEFAULT '0' COMMENT '文章点击数',
  `satisfactory_num` int(11) DEFAULT '0' COMMENT '文章点赞数',
  `dissatisfied_num` int(11) DEFAULT '0' COMMENT '文章不满意数',
  `comment_num` int(11) DEFAULT '0' COMMENT '文章评论数',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` int(11) DEFAULT '0' COMMENT '0：未发布 1：发布',
  `enable` bit(1) DEFAULT b'1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=58 DEFAULT CHARSET=utf8 COMMENT='博客文章表';

-- ----------------------------
-- Records of blog_articles
-- ----------------------------

-- ----------------------------
-- Table structure for blog_articles_tag
-- ----------------------------
DROP TABLE IF EXISTS `blog_articles_tag`;
CREATE TABLE `blog_articles_tag` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `blog_tag_id` int(11) DEFAULT NULL COMMENT '博客tagid',
  `blog_articles_id` int(11) DEFAULT NULL COMMENT '博客文章id',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` int(11) DEFAULT NULL COMMENT '状态',
  `enable` bit(1) DEFAULT b'1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=145 DEFAULT CHARSET=utf8 COMMENT='博客标签与博客文章中间表';

-- ----------------------------
-- Records of blog_articles_tag
-- ----------------------------

-- ----------------------------
-- Table structure for blog_tag
-- ----------------------------
DROP TABLE IF EXISTS `blog_tag`;
CREATE TABLE `blog_tag` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `name` varchar(20) DEFAULT NULL COMMENT 'tag名称',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` int(11) DEFAULT NULL COMMENT '状态',
  `enable` bit(1) DEFAULT b'1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='博客标签表';

-- ----------------------------
-- Records of blog_tag
-- ----------------------------

-- ----------------------------
-- Table structure for comment_articles
-- ----------------------------
DROP TABLE IF EXISTS `comment_articles`;
CREATE TABLE `comment_articles` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `blog_articles_id` int(11) DEFAULT NULL COMMENT '文章id',
  `type` int(11) DEFAULT NULL COMMENT '评论类型',
  `cover_image` varchar(255) DEFAULT NULL COMMENT '评论人头像',
  `author` varchar(32) DEFAULT NULL COMMENT '评论人',
  `email` varchar(32) DEFAULT NULL COMMENT '评论邮箱',
  `content` text COMMENT '评论内容',
  `author_location_province` varchar(32) DEFAULT NULL COMMENT '评论人所在省',
  `author_location_city` varchar(32) DEFAULT NULL COMMENT '评论人所在市',
  `satisfactory_num` int(11) DEFAULT '0' COMMENT '评论点赞数',
  `dissatisfied_num` int(11) DEFAULT '0' COMMENT '评论不满意数',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` int(11) DEFAULT '0' COMMENT '状态',
  `enable` bit(1) DEFAULT b'1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=72 DEFAULT CHARSET=utf8 COMMENT='文章评论表';

-- ----------------------------
-- Records of comment_articles
-- ----------------------------

-- ----------------------------
-- Table structure for photo_album
-- ----------------------------
DROP TABLE IF EXISTS `photo_album`;
CREATE TABLE `photo_album` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `title` varchar(32) DEFAULT NULL COMMENT '图片标题',
  `outline` varchar(255) DEFAULT NULL COMMENT '图片概要',
  `url` varchar(255) DEFAULT NULL COMMENT '链接url',
  `category` varchar(32) DEFAULT NULL COMMENT '相册分类',
  `type` int(11) DEFAULT NULL COMMENT '图片类型 0-转载 1-原创 2-精图',
  `order_num` int(11) DEFAULT NULL COMMENT '排序号',
  `shooting_time` datetime DEFAULT NULL COMMENT '拍摄时间-默认是创建时间,可修改',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` int(11) DEFAULT '0',
  `enable` bit(1) DEFAULT b'1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='相册表';

-- ----------------------------
-- Records of photo_album
-- ----------------------------

-- ----------------------------
-- Table structure for sys_login_history
-- ----------------------------
DROP TABLE IF EXISTS `sys_login_history`;
CREATE TABLE `sys_login_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` int(11) DEFAULT NULL COMMENT '登录用户id',
  `username` varchar(30) DEFAULT NULL COMMENT '登录用户姓名',
  `ip` varchar(30) DEFAULT NULL COMMENT '登录ip',
  `ip_location_province` varchar(30) DEFAULT NULL COMMENT 'ip所在省',
  `ip_location_city` varchar(30) DEFAULT NULL COMMENT 'ip所在市',
  `ip_location` varchar(255) DEFAULT NULL COMMENT 'ip所在地详细地址',
  `device_type` varchar(30) DEFAULT NULL COMMENT '登录设备类型',
  `device_system` varchar(30) DEFAULT NULL COMMENT '登录设备系统',
  `device_version` varchar(30) DEFAULT NULL COMMENT '登录设备版本',
  `browser` varchar(30) DEFAULT NULL COMMENT '登录设备使用的浏览器',
  `useragent` varchar(255) DEFAULT NULL COMMENT '用户代理',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` int(11) DEFAULT '0' COMMENT '状态: 0: 登入成功 1: 登入失败 ',
  `enable` bit(1) DEFAULT b'1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1823 DEFAULT CHARSET=utf8 COMMENT='用户登录历史表';

-- ----------------------------
-- Records of sys_login_history
-- ----------------------------

-- ----------------------------
-- Table structure for sys_menu
-- ----------------------------
DROP TABLE IF EXISTS `sys_menu`;
CREATE TABLE `sys_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `first_menu` varchar(30) DEFAULT NULL COMMENT '一级菜单名',
  `second_menu` varchar(30) DEFAULT NULL COMMENT '二级菜单名',
  `type` int(11) DEFAULT NULL COMMENT '类型(0-一级菜单 1-二级菜单)',
  `icon` varchar(30) DEFAULT NULL COMMENT '图标',
  `url` varchar(255) DEFAULT NULL COMMENT 'url链接',
  `order_num` int(11) DEFAULT NULL COMMENT '排序号',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` int(11) DEFAULT '0' COMMENT '菜单状态-0 可见 1-不可见',
  `enable` bit(1) DEFAULT b'1' COMMENT '是否启用',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8 COMMENT='系统菜单表';

-- ----------------------------
-- Records of sys_menu
-- ----------------------------

-- ----------------------------
-- Table structure for sys_oss_file
-- ----------------------------
DROP TABLE IF EXISTS `sys_oss_file`;
CREATE TABLE `sys_oss_file` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `file_name` varchar(255) DEFAULT NULL COMMENT '文件名称',
  `file_size` int(11) DEFAULT NULL COMMENT '文件大小',
  `file_type` varchar(255) DEFAULT NULL COMMENT '文件类型',
  `file_src` varchar(255) DEFAULT NULL COMMENT 'Oss文件路径',
  `file_key` varchar(255) DEFAULT NULL COMMENT '文件key',
  `upload_status` varchar(255) DEFAULT NULL COMMENT '上传状态',
  `upload_message` varchar(255) DEFAULT NULL COMMENT '上传消息',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(255) DEFAULT NULL,
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `last_modified_by` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
