-- ----------------------------
-- Table structure for sys_permission
-- ----------------------------
DROP TABLE IF EXISTS `sys_permission`;
CREATE TABLE `sys_permission` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `permission_code` varchar(50) DEFAULT NULL COMMENT '权限code',
  `permission_name` varchar(50) DEFAULT NULL COMMENT '权限名字',
  `permission_type` int(11) DEFAULT NULL COMMENT '权限类型 0-菜单 1-按钮 2:-权限',
  `parent_id` int(11) DEFAULT NULL COMMENT '父节点id',
  `level` int(11) DEFAULT NULL COMMENT '级别',
  `order_num` int(11) DEFAULT NULL COMMENT '排序号',
  `description` varchar(255) DEFAULT NULL COMMENT '权限描述',
  `created_date` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `created_by` varchar(32) DEFAULT NULL COMMENT '创建人',
  `last_modified_date` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  `last_modified_by` varchar(32) DEFAULT NULL COMMENT '最后修改人',
  `remarks` varchar(255) DEFAULT NULL COMMENT '备注',
  `status` int(11) DEFAULT NULL COMMENT '状态',
  `enable` bit(1) DEFAULT b'1' COMMENT '逻辑删除标志',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8 COMMENT='权限表';

-- ----------------------------
-- Records of sys_permission
-- ----------------------------

-- ----------------------------
-- Table structure for sys_resource
-- ----------------------------
