INSERT INTO `blog_articles` VALUES ('20', '百度富文本框编辑器Ueditor', 'UEditor是由百度web前端研发部开发所见即所得富文本web编辑器，具有轻量，可定制，注重用户体验等特点，开源基于MIT协议，允许自由使用和修改代码', 'http://111.230.226.158/uploadfile/20180606/004643-211259-fd1bd678e545012e8f78a8a50f968800.jpg', '<h1><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 24px;\">百度富文本框编辑器：</span></h1><p><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">官网： </span><a href=\"http://ueditor.baidu.com/website/\" target=\"_blank\" style=\"text-decoration: underline; font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">http://ueditor.baidu.com/website/</span></a> </p><p><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">官网演示地址：</span><a href=\"http://ueditor.baidu.com/website/onlinedemo.html\" target=\"_blank\" style=\"text-decoration: underline; font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">http://ueditor.baidu.com/website/onlinedemo.html</span></a></p><p><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">UEditor是由百度web前端研发部开发所见即所得富文本web编辑器，具有轻量，可定制，注重用户体验等特点，开源基于MIT协议，允许自由使用和修改代码…</span></p><p><br/></p><h4><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">开始使用：</span></h4><p><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">参考:</span></p><p><span style=\"text-decoration: underline; font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><a href=\"http://fex.baidu.com/ueditor/\" target=\"_blank\" style=\"text-decoration: underline; font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">http://fex.baidu.com/ueditor/</a></span></p><p><br/></p><h5><strong><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\">1. 入门部署和体验</span></strong></h5><h5><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">1.1下载编辑器</span></h5><p><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">到官网下载 UEditor 最新版：[官网地址]</span></p><p><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\"><br/></span></p><h5><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">1.2创建demo文件</span></h5><p><span style=\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">解压下载的包，在解压后的目录创建 demo.html 文件，填入下面的html代码</span></p><pre class=\"brush:html;toolbar:false\">&lt;!DOCTYPE&nbsp;HTML&gt;\n&lt;html&gt;\n&lt;head&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;meta&nbsp;charset=&quot;UTF-8&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;title&gt;ueditor&nbsp;demo&lt;/title&gt;\n&lt;/head&gt;\n&lt;body&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;加载编辑器的容器&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;script&nbsp;id=&quot;container&quot;&nbsp;name=&quot;content&quot;&nbsp;type=&quot;text/plain&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;这里写你的初始化内容\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/script&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;配置文件&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;script&nbsp;type=&quot;text/javascript&quot;&nbsp;src=&quot;ueditor.config.js&quot;&gt;&lt;/script&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;编辑器源码文件&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;script&nbsp;type=&quot;text/javascript&quot;&nbsp;src=&quot;ueditor.all.js&quot;&gt;&lt;/script&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;实例化编辑器&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;script&nbsp;type=&quot;text/javascript&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;var&nbsp;ue&nbsp;=&nbsp;UE.getEditor(&#39;container&#39;);\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/script&gt;\n&lt;/body&gt;\n&lt;/html&gt;</pre><h5><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 16px;\"><br/></span></h5><h5><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 16px;\">1.3 在浏览器打开demo.html</span></h5><p><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 16px;\">如果看到了编辑器，恭喜你，初次部署成功！</span></p><p><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 16px;\"><br/></span></p><p><strong><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 20px;\">2. 编辑器测试</span></strong></p><h1 style=\"font-size: 32px; font-weight: bold; border-bottom: 2px solid rgb(204, 204, 204); padding: 0px 4px 0px 0px; text-align: left; margin: 0px 0px 10px;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 16px;\">1： 测试图片</span></h1><p style=\"text-align: center;\"><img src=\"http://111.230.226.158/uploadfile/20180725/145525-school.jpg\" title=\"school.jpg\" alt=\"school.jpg\"/></p><p><br/></p><h1 style=\"font-size: 32px; font-weight: bold; border-bottom: 2px solid rgb(204, 204, 204); padding: 0px 4px 0px 0px; text-align: left; margin: 0px 0px 10px;\"><span style=\"font-size: 16px;\">2：测试表情</span><img src=\"http://img.baidu.com/hi/jx2/j_0002.gif\"/><img src=\"http://img.baidu.com/hi/jx2/j_0004.gif\"/><img src=\"http://img.baidu.com/hi/face/i_f01.gif\"/><img src=\"http://img.baidu.com/hi/youa/y_0035.gif\"/></h1><p><br/></p><p><br/></p><h1 style=\"font-size: 32px; font-weight: bold; border-bottom: 2px solid rgb(204, 204, 204); padding: 0px 4px 0px 0px; text-align: left; margin: 0px 0px 10px;\"><span style=\"font-size: 16px;\">3： 测试涂鸦</span></h1><p><br/></p><p><img src=\"http://111.230.226.158/uploadfile/20180725/145557-scrawl1532501756958.png\" title=\"scrawl1532501756958.png\" alt=\"scrawl1532501756958.png\"/></p><p><br/></p><h1 style=\"font-size: 32px; font-weight: bold; border-bottom: 2px solid rgb(204, 204, 204); padding: 0px 4px 0px 0px; text-align: left; margin: 0px 0px 10px;\"><span style=\"font-size: 16px;\">4： 测试视频</span></h1><p><embed src=\"https://imgcache.qq.com/tencentvideo_v1/playerv3/TPout.swf?max_age=86400&v=20161117&vid=u0540ogtg8u&auto=0\" allowfullscreen=\"true\" width=\"1150\" height=\"600\" align=\"middle\" allowscriptaccess=\"always\" type=\"application/x-shockwave-flash\"/></p><h1 style=\"font-size: 32px; font-weight: bold; border-bottom: 2px solid rgb(204, 204, 204); padding: 0px 4px 0px 0px; text-align: left; margin: 0px 0px 10px;\"><span style=\"font-size: 16px;\">5:测试文件</span></h1><p><br/></p><p style=\"line-height: 16px;\"><img src=\"/static/plugins/ueditor/dialogs/attachment/fileTypeImages/icon_txt.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"http://songshuiyang-oss.oss-cn-shenzhen.aliyuncs.com/blogsys/upload/20180321/004201-oss-test.txt\" title=\"oss-test.txt\">oss-test.txt</a></p><p><br/></p><h1 style=\"font-size: 32px; font-weight: bold; border-bottom: 2px solid rgb(204, 204, 204); padding: 0px 4px 0px 0px; text-align: left; margin: 0px 0px 10px;\"><span style=\"font-size: 16px;\">6： 百度地图</span></h1><p><img width=\"530\" height=\"340\" src=\"http://api.map.baidu.com/staticimage?center=116.404,39.915&zoom=10&width=530&height=340&markers=116.404,39.915\"/></p><p><br/></p><p><br/></p><p><br/></p><p><br/></p><p><span class=\"edui-editor-imagescale-hand1\" style=\"position: absolute; width: 6px; height: 6px; overflow: hidden; font-size: 0px; display: block; background-color: rgb(60, 157, 208); cursor: n-resize; top: 0px; margin-top: -4px; left: 227px; margin-left: -4px; font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif;\"></span><span class=\"edui-editor-imagescale-hand2\" style=\"position: absolute; width: 6px; height: 6px; overflow: hidden; font-size: 0px; display: block; background-color: rgb(60, 157, 208); cursor: ne-resize; top: 0px; margin-top: -4px; left: 454px; margin-left: -3px; font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif;\"></span><span class=\"edui-editor-imagescale-hand3\" style=\"position: absolute; width: 6px; height: 6px; overflow: hidden; font-size: 0px; display: block; background-color: rgb(60, 157, 208); cursor: w-resize; top: 383px; margin-top: -4px; left: 0px; margin-left: -4px; font-family: &quot;Helvetica Neue&quot;, Helvetica, &quot;PingFang SC&quot;, 微软雅黑, Tahoma, Arial, sans-serif;\"><br/><br/></span></p>', 'admin', '前端插件', '1', '29,30', '812', '257', '36', '21', '2018-02-28 10:52:16', 'admin', '2018-08-24 19:26:50', 'admin', '23423423', '1', '');
INSERT INTO `blog_articles` VALUES ('54', '揭秘SEO顶级高手如何一个月把几十个关键词做到百度首页', '首先说明一点，做网络SEO优化主要分为：初期、中期和后期三大阶段，每个时期都应该采用相应的策略来进行优化。', 'http://111.230.226.158/uploadfile/20180606/004702-225204-82545e75dfb7627d985d574dd93ae720.jpg', '<p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\">首先说明一点，做网络SEO优化主要分为：初期、中期和后期三大阶段，每个时期都应该采用相应的策略来进行优化。如果你的网站关键词排名在100名以外的话，那么我们就需要做好网站的基础优化，如果你的网站关键词在前20名之内，我们就需要加大我们网站用户体验。如果你的关键词在前2页，那么我们就要想着如何才能够进首页，所以说关键词排名的不同时期，我们都应该采取相应的策略。</span></p><p style=\"text-align:center\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><img src=\"http://www.qqseo8.com/wp-content/uploads/2015/08/gjcyh.jpg\"/></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\">不同行业的用户体验是不同的，不同关键词的用户体验核心点也是截然不同的，我们是否能够把握用户核心需求，真正为之解决将成为做好用户体验的关键。例如用户想要苹果，你却给的是梨子，试问一下，你的用户体验不好，百度凭什么会给你排名呢?</span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\">&nbsp; &nbsp;<br/></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\">我们在百度随便搜索某一个关键词，可以看到有很多的网站内页参与排名，并且这样的网站权重是很高的，这个时候你来做一个新站，并且想要超过这些排名很好的网站，那么这个时候我们就需要利用数据分析，来分析一下这些页面当中有哪些是不够完善的，然后利用我们的网页去填补这些不够完善的空缺，从而达到快速排名的效果。</span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"></span></span></p><h3 style=\"margin: 30px 0px 10px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; border-bottom: 1px solid rgb(221, 221, 221); font-size: inherit; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">一：数据分析</h3><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\">作为一个站长,对于数据分析的重要性必然是不言而喻的。我们需要分析的不仅仅是自己网站的数据,还有包括竞争对手的数据。正所谓知己知彼,百战不殆。对于自己的网站就得掌握精确的用户动向得到高转换。要让SEO有一个排名和转换的突破就必须知道怎么去做数据分析。</span></p><p style=\"text-indent: 2em;\"><br/></p><p style=\"text-indent: 2em;\"><strong style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; white-space: normal; background-color: rgb(255, 255, 255);\">第一：前后对比</strong></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\">大部分人在分析数据的时候会关心每天的ip量是多少、pv、uv,但是忘记了对比前后的变动。比如这周或者今天的跳出率增加了,有可能是我们的竞价页面做了改动,也有可能是我们推荐在首页的内容质量比较差。有可能是质量比较好但是用户对这个内容不感兴趣,这时候我们需要结合热力图来做比较。一旦发现哪些内容用户比较关心,我们就将对应的内容推荐到用户比较容易看到的位置,然后再持续观察。还有一点需要注意的是对于处在网站不同位置的点击要区分,如果处在网站下方的某个链接跟上方的某个链接点击次数差不多,那么就要将下方的链接推荐上去。</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\"><strong>第二：逻辑分析</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">在看完一个数据后最明显的是跳出率、ip、pv这些通常有一个大概范围的值,但是不同行业数据是不一样的。比如论坛的停留时间会比较长、跳出率会很低,机械行业的跳出率会高。基于数据的不同我们怎么分析自己的行业?所以需要学会逻辑分析,就是这个数据为什么是这样的,还可以提升吗?从哪些方面提升,或者这个数据对我们有用吗?为什么机械的站的停留时间是2分钟,影响停留时间的有哪些?怎么才可以改善或者已经到了最佳的状态了。每一个数据都要这样认真去思考他的原因以及影响因素,这样在分析数据的时候就不会一头雾水,看完就看完了。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\"><strong>第三：综合比对</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">做好上面二步的数据分析之后，我们还要用好用好体验，其中重点查看用好搜索的关键词，用户查看了那些页面，用户如何找到网站页面等等，这些数据都要详细分析，并转化应用到自己的网站中去，只有这样，才能不断对网站首页、内页内容做好SEO优化各类细节，而细节往往决定着成败。</p><h3 style=\"margin: 30px 0px 10px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; border-bottom: 1px solid rgb(221, 221, 221); font-size: inherit; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">　　二： 用户体验</h3><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">用户体验，即用户在使用一个产品或系统之前、使用期间和使用之后的全部感受，包括情感、信仰、喜好、认知印象、生理和心理反应、行为和成就等各个方面。该说明还列出三个影响用户体验的因素：系统，用户和使用环境。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">一个网站做好后，首先应该考虑的就是网站如何做好用户体验，一个网站的用户体验，直接决定了你网站的跳出率，一个网站的跳出率少了，自然的用户体验就好了，用户体验好了搜索引擎也会青睐你。我们本身做网站，就是给自己所面向的客户考虑的，百度也是这样，它也是一直强调能让用户搜到自己想要的东西</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">当你的关键词进入前20名的时候，其实这个时候外链已经起不到很大的作用了。这个时候决定关键词排名就是用户投票了，假设这里有A和B两个页面，当用户访问A页面时，用户在A页面停留的时间比较长，在B页面访问的时间比较短，那么这个时候百度就会认为A页面会比B页面更有价值，从而会把A页面的排名给提升上来。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\"><strong>网站的用户体验如何能提高</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">搜索引擎算法的不断更新完善，目的是让用户有一个更好的用户体验，说白了就是让用户找到自己所找的东西，进而让网站能留住用户，提高网站的用户体验度。其实网站用户体验一直都是个很宽泛的概念，总结起来用户体验要从以下几个方面来做：网站性能、视觉设计、导航分类、站内搜索、网站内容、交互设计、登录(付款)方式。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">第一、网站性能网站页面打开速度是否快，网站打开速度的快与慢直接影响用户的体验，一个打开慢的网站肯定是不受用户喜欢的。还有网站不要有过多的图片，图片量过多直接会影响网站打开速度，网站性能不仅影响用户的浏览体验，也直接影响SEO效果。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">第二、视觉设计颜色搭配是否符合网站定位，风格设计是否符合目标用户喜好，这是决定用户是否驻足停留的关键。主要是符合大众的喜好，只有这样才能吸引用户，增加用户体验度，给网站带来很好的权重。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">第三、一般的网站至少有三个层面，首页-栏目页-终极页面，点入一个网页，要让用户知道如何返回上一个页面，或者用新窗口的形式弹出终极页面，关闭后能返回上一个页面。并且要指导用户如何找到他想要的内容或者产品。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">第四、导航分类对于没有明确目的的用户，在网站上放置搜索功能，让用户方便找到想要的内容。大型网站都会有自己的搜索引擎，而且有自己的算法，研究如何设置算法才能搜索到用户想要的内容。这对用户体验有很大帮助，尤其是想在你的网站产生交易的用户。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">第五、网站内容是网站的血液，所谓的内容为王，这是恒久不变的真理。不管算法怎么变，搜索引擎都是喜欢原创文章，因为这是用户所需要的，一篇文章被复制多少遍，用户看了对于用户来说毫无意义，所以只有原创文章对用户才有帮助，于是搜索引擎就更加喜欢原创文章，对于这个网站就会更加信赖。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">第六、交互设计交互设计包含3个方面：界面设计、导航设计和信息设计。可以留下你的联系方式，也可以做一个浮窗让用户主动联系你。该有的QQ、邮箱、MSN都应该有，如果用户想进行交易却联系不到你，又亏了。</p><h3 style=\"margin: 30px 0px 10px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; border-bottom: 1px solid rgb(221, 221, 221); font-size: inherit; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">　　三： 细节分析</h3><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\"><strong>第一：站内投票</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">站内投票与站外投票两种方式，想比而言，还是站内投票来的更加实惠，而且更加有可控性。百度在判断一个网页是否是高质量的时候，很大的程度上是决定于页面投票的，所以说，当你想要优化某个关键词的时候，就请你适当的做好网站的站内投票吧。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\"><strong>第二：网站关键词分析</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">当用户通过某个关键词进入我们的网站，从而到达某个页面，如果说这个页面的跳出率达到80%以上，那么这个时候百度就不会给予我们良好的排名，如果该页面的跳出率比较高，那么请你开始着手改进该页面。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\"><strong>第三：流量页面分析</strong></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">通常我们把一个可以获得大量流量的页面称之为网站流量页面。我们请仔细观察这样的页面，并且把它给提取出来，让这样的页面更加直接的展现出来，然后通过该页面导向其它站内页面，从而让用户最大化的消费我们的网站，这样就会增加我们我们站内的PV，从而就会获得良好的排名。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 2em; color: rgb(69, 69, 69); white-space: normal; background-color: rgb(255, 255, 255);\">一个网站如何做好和提高用户体验，关键在于一个站长的诚实度和对用户体验的理解能力，我们一定要站在用户的角度上去浏览你的网站，只有当你自己觉得自己的网站很好，并且用户的体验也非常好跳出率低内容受欢迎，才能让用户也喜欢上你的网站，让用户体验度提升上来。有很多的做网络SEO的同仁们一直说现在SEO越来越难做，排名很难，其实你有没有真正的去分析过原因呢?有没有真正做到人无我有，我有我优的境界呢?假设当我们站在用户的角度去思考问题的时候，排名其实就是自然而然的事情。</p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p style=\"text-indent: 2em;\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><span style=\"color: rgb(69, 69, 69); font-family: Verdana, &quot;Microsoft YaHei&quot;; text-indent: 32px; background-color: rgb(255, 255, 255);\"><br/></span></span></p>', 'SEO学堂', '网站', '0', '28', '192', '15', '122', '4', '2018-04-19 22:54:39', 'admin', '2018-08-24 19:27:34', 'admin', '', '1', '');
INSERT INTO `blog_articles` VALUES ('55', '阿里巴巴Java编程规范 ', '你是否曾因Java代码规范版本纷杂而无所适从？你是否想过代码规范能将系统故障率降低20%？你是否曾因团队代码风格迥异而协同困难？你是否正在review一些原本可以避免的故障？你是否无法确定自己的代码足够健壮？ ', 'http://111.230.226.158/uploadfile/20180606/004725-213549-a8d7ee69c946f9530024a68af9909249.jpg', '<h2>关于《阿里巴巴Java开发手册》</h2><p>你是否曾因Java代码规范版本纷杂而无所适从？</p><p>你是否想过代码规范能将系统故障率降低20%？</p><p>你是否曾因团队代码风格迥异而协同困难？</p><p>你是否正在review一些原本可以避免的故障？</p><p>你是否无法确定自己的代码足够健壮？&nbsp;</p><p><br/></p><h3>码出高效，码出质量！</h3><p>相比C++代码规范业界已经达成共识，Java代码规范业界比较混乱，我们期待这次发布的Java代码规范能够给业界带来一个标准，促使整体行业代码规范水平得到提高，最终能够帮助企业和开发者提升代码质量和降低代码故障率。</p><p><br/></p><h3>阿里出品，质量保证！</h3><p>阿里Java技术团队一手打造出Dubbo、JStorm、Fastjson等诸多流行开源框架，部分已成为Apache基金会孵化项目；</p><p>阿里在Java后端领域支撑起全球访问量最大的服务器集群；</p><p>Java代码构建的阿里双11业务系统订单处理能力达到17.5万笔/秒；</p><p>到目前已累计数亿行高并发、高稳定性的最佳Java代码实践；</p><p>……</p><p>此次公开的Java开发手册正是出自这样的团队，近万名阿里Java技术精英的经验总结，并经历了多次大规模一线实战检验及完善，铸就了这本高含金量的阿里Java开发手册。该手册以Java开发者为中心视角，划分为编程规约、异常日志规约、MYSQL规约、工程规约、安全规约五大块，再根据内容特征，细分成若干二级子目录。根据约束力强弱和故障敏感性，规约依次分为强制、推荐、参考三大类。此套规范不仅能让代码一目了然，\n 更有助于加强团队分工与合作、真正提升效率。&nbsp;</p><p><br/></p><h3>无规矩不成方圆 无规范不能协作</h3><p>众所周知，制订交通法规表面上是要限制行车权，实际上是保障公众的人身安全。试想如果没有限速，没有红绿灯，没有规定靠右行驶，谁还敢上路行驶。</p><p>同理，对软件来说，适当的规范和标准绝不是消灭代码内容的创造性、优雅性，而是限制过度个性化，以一种普遍认可的方式一起做事，降低故障率，提升协作效率。开发手册详细列举如何开发更加高效，更加容错，更加有协作性，力求知其然，更知其不然，结合正反例，提高代码质量。比如，异常日志处理时的各种不规范行为；集合转换的各种坑；创建线程池出现的等待队列OOM等。&nbsp;&nbsp;</p><p><br/></p><h3>阿里技术资深大咖联袂推荐</h3><p>阿里高级研究员多隆：工程师对于代码，一定要“精益求精”，不论从性能，还是简洁优雅，都要具备“精益求精”的工匠精神，认真打磨自己的作品。</p><p>阿里研究员毕玄：一个优秀的工程师和一个普通工程师的区别，不是现在满天飞的架构图，他的功底就是体现在他写的每一行代码上。</p><p>阿里研究员玄难：代码是软件工程里面的产品设计、系统架构设计等工作的最后承载体，代码的质量决定了一切工作的成败。</p><p>阿里巴巴B2B事业群CTO李纯：好的软件产品离不开工程师高质量的代码及相互间顺畅的沟通与合作。简单，适用的代码规约背后所传递的是技术上的追求卓越、协同合作的精神，是每个技术团队不可缺失的重要利器。</p><p>阿里研究员、HipHop作者：赵海平（花名：福贝）：程序员是创造个性化作品的艺术家，但同时也是需要团队合作的工种。个性化应尽量表现在代码效率和算法方面，牺牲小我，成就大我。</p><p><br/></p><h3>拥抱规范，远离伤害！</h3><p>开发的同学们赶紧行动起来，遵守代码规范，你好，我好，大家好！</p><p><br/></p><h3>传送门</h3><ol class=\" list-paddingleft-2\"><li><p>原文: <a href=\"https://yq.aliyun.com/articles/69327?spm=5176.100239.blogcont69327.158.xUUgiz&p=2#comments\" target=\"_blank\">https://yq.aliyun.com/articles/69327?spm=5176.100239.blogcont69327.158.xUUgiz&amp;p=2#comments</a></p></li><li><p>「阿里巴巴编码规范」考试认证 : <a href=\"https://edu.aliyun.com/certification/cldt02\" target=\"_blank\">https://edu.aliyun.com/certification/cldt02</a></p></li><li><p>点击下载《阿里巴巴Java开发手册》(纪念版): <a href=\"https://yq.aliyun.com/attachment/download/?id=4942\" target=\"_blank\">https://yq.aliyun.com/attachment/download/?id=4942</a></p></li><li><p>IDE插件下载 : <a href=\"https://github.com/alibaba/p3c\" target=\"_blank\">https://github.com/alibaba/p3c</a></p></li></ol><p><br/></p>', '阿里巴巴', 'JAVA', '0', '25,33', '196', '19', '9', '1', '2018-04-22 21:41:42', 'admin', '2018-08-24 19:27:45', 'admin', '', '1', '');
INSERT INTO `blog_articles` VALUES ('56', 'Spring 集成Redis ', 'Redis是一个开源的使用ANSI C语言编写、支持网络、可基于内存亦可持久化的日志型、Key-Value数据库，并提供多种语言的API。从2010年3月15日起，Redis的开发工作由VMware主持。从2013年5月开始，Redis的开发由Pivotal赞助。', 'http://111.230.226.158/uploadfile/20180606/004744-214406-redis.png', '<h2>一：导入maven</h2><pre class=\"brush:xml;toolbar:false;\">&lt;!--redis--&gt;\n&lt;dependency&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;groupId&gt;redis.clients&lt;/groupId&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;artifactId&gt;jedis&lt;/artifactId&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;version&gt;2.9.0&lt;/version&gt;\n&lt;/dependency&gt;\n&lt;dependency&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;groupId&gt;org.springframework.data&lt;/groupId&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;artifactId&gt;spring-data-redis&lt;/artifactId&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;version&gt;1.6.2.RELEASE&lt;/version&gt;\n&lt;/dependency&gt;</pre><h2>二：新建 <code>redis-config.properties</code></h2><pre class=\"brush:java;toolbar:false\">#&nbsp;Redis&nbsp;settings\nredis.host=127.0.0.1\nredis.port=6379\nredis.pass=shuiyang\nredis.dbIndex=0\nredis.expiration=3000\n#最大空闲数\nredis.maxIdle=300\n#连接池的最大数据库连接数。设为0表示无限制,如果是jedis&nbsp;2.4以后用redis.maxTotal\nredis.maxActive=600\n#最大建立连接等待时间。如果超过此时间将接到异常。设为-1表示无限制。\nredis.maxWait=1000\n#是否在从池中取出连接前进行检验,如果检验失败,则从池中去除连接并尝试取出另一个\nredis.testOnBorrow=true</pre><p><br/></p><h2>三： 新建 <code>applicationContext-redis.xml</code></h2><pre class=\"brush:xml;toolbar:false\">&lt;beans&nbsp;xmlns=&quot;http://www.springframework.org/schema/beans&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xmlns:xsi=&quot;http://www.w3.org/2001/XMLSchema-instance&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xmlns:context=&quot;http://www.springframework.org/schema/context&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xmlns:aop=&quot;http://www.springframework.org/schema/aop&quot;&nbsp;xmlns:tx=&quot;http://www.springframework.org/schema/tx&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xmlns:cache=&quot;http://www.springframework.org/schema/cache&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xsi:schemaLocation=&quot;http://www.springframework.org/schema/beans\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.springframework.org/schema/beans/spring-beans-4.0.xsd\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.springframework.org/schema/context\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.springframework.org/schema/context/spring-context-4.0.xsd\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.springframework.org/schema/aop&nbsp;http://www.springframework.org/schema/aop/spring-aop-4.0.xsd\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.springframework.org/schema/tx&nbsp;http://www.springframework.org/schema/tx/spring-tx-4.0.xsd\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;http://www.springframework.org/schema/cache&nbsp;http://www.springframework.org/schema/cache/spring-cache.xsd&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;启用缓存注解开关&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;cache:annotation-driven&nbsp;cache-manager=&quot;cacheManager&quot;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;配置JedisPoolConfig实例&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;id=&quot;poolConfig&quot;&nbsp;class=&quot;redis.clients.jedis.JedisPoolConfig&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;maxIdle&quot;&nbsp;value=&quot;${redis.maxIdle}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;maxTotal&quot;&nbsp;value=&quot;${redis.maxActive}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;maxWaitMillis&quot;&nbsp;value=&quot;${redis.maxWait}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;testOnBorrow&quot;&nbsp;value=&quot;${redis.testOnBorrow}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;配置JedisConnectionFactory&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;id=&quot;jedisConnectionFactory&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;class=&quot;org.springframework.data.redis.connection.jedis.JedisConnectionFactory&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;hostName&quot;&nbsp;value=&quot;${redis.host}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;port&quot;&nbsp;value=&quot;${redis.port}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;password&quot;&nbsp;value=&quot;${redis.pass}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;database&quot;&nbsp;value=&quot;${redis.dbIndex}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;poolConfig&quot;&nbsp;ref=&quot;poolConfig&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;配置RedisTemplate&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;id=&quot;redisTemplate&quot;&nbsp;class=&quot;org.springframework.data.redis.core.RedisTemplate&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;connectionFactory&quot;&nbsp;ref=&quot;jedisConnectionFactory&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;配置RedisCacheManager&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;id=&quot;cacheManager&quot;&nbsp;class=&quot;org.springframework.data.redis.cache.RedisCacheManager&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;constructor-arg&nbsp;name=&quot;redisOperations&quot;&nbsp;ref=&quot;redisTemplate&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;defaultExpiration&quot;&nbsp;value=&quot;${redis.expiration}&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;配置RedisCacheManager&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;id=&quot;cacheManager&quot;&nbsp;class=&quot;org.springframework.cache.support.SimpleCacheManager&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;caches&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;set&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;这里可以配置多个redis&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;class=&quot;com.ecut.core.config.RedisCache&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;redisTemplate&quot;&nbsp;ref=&quot;redisTemplate&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;name&quot;&nbsp;value=&quot;articlesDetail&quot;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;class=&quot;com.ecut.core.config.RedisCache&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;redisTemplate&quot;&nbsp;ref=&quot;redisTemplate&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;name&quot;&nbsp;value=&quot;getHotArticlesInCache&quot;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;class=&quot;com.ecut.core.config.RedisCache&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;redisTemplate&quot;&nbsp;ref=&quot;redisTemplate&quot;&nbsp;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;name&quot;&nbsp;value=&quot;articlesList&quot;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/set&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/property&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&lt;/beans&gt;</pre><h2>四： 引入 <code>applicationContext-redis.xml redis-config.properties</code></h2><p><code><br/></code></p><pre class=\"brush:xml;toolbar:false\">&lt;?xml&nbsp;version=&quot;1.0&quot;&nbsp;encoding=&quot;UTF-8&quot;?&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;beans&nbsp;xmlns=&quot;http://www.springframework.org/schema/beans&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xmlns:xsi=&quot;http://www.w3.org/2001/XMLSchema-instance&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xmlns:context=&quot;http://www.springframework.org/schema/context&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xmlns:p=&quot;http://www.springframework.org/schema/p&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xmlns:mvc=&quot;http://www.springframework.org/schema/mvc&quot;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;xsi:schemaLocation=&quot;http://www.springframework.org/schema/beans\n	http://www.springframework.org/schema/beans/spring-beans.xsd\n	http://www.springframework.org/schema/context\n	http://www.springframework.org/schema/context/spring-context.xsd\n	http://www.springframework.org/schema/mvc\n	http://www.springframework.org/schema/mvc/spring-mvc-4.0.xsd&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--使标注Spring注解的类生效--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;context:component-scan&nbsp;base-package=&quot;com.ecut&quot;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;将多个配置文件读取到容器中，交给Spring管理&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;bean&nbsp;id=&quot;propertyConfigurer&quot;&nbsp;class=&quot;com.ecut.core.spring.PropertyPlaceholderConfigurerFilter&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;property&nbsp;name=&quot;locations&quot;&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;list&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;这里支持多种寻址方式：classpath和file&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;value&gt;classpath:project.properties&lt;/value&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&nbsp;推荐使用file的方式引入，这样可以将配置和代码分离&nbsp;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;value&gt;classpath:jdbc.properties&lt;/value&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;value&gt;classpath:redis-config.properties&lt;/value&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/list&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&lt;/property&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;/bean&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;import&nbsp;resource=&quot;applicationContext-dao.xml&quot;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;import&nbsp;resource=&quot;applicationContext-shiro.xml&quot;/&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--encache&nbsp;redis选择一种缓存--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;!--&lt;import&nbsp;resource=&quot;applicationContext-encache.xml&quot;/&gt;--&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;import&nbsp;resource=&quot;applicationContext-redis.xml&quot;/&gt;\n&lt;/beans&gt;</pre><p><br/></p><h2><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">五：新建 </span><code style=\"font-size: 16px;\"><span style=\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\">RedisCache.java</span></code></h2><pre class=\"brush:java;toolbar:false\">package&nbsp;com.ecut.core.config;\nimport&nbsp;java.io.Serializable;\nimport&nbsp;org.apache.commons.lang3.SerializationUtils;\nimport&nbsp;org.slf4j.Logger;\nimport&nbsp;org.slf4j.LoggerFactory;\nimport&nbsp;org.springframework.cache.Cache;\nimport&nbsp;org.springframework.cache.support.SimpleValueWrapper;\nimport&nbsp;org.springframework.dao.DataAccessException;\nimport&nbsp;org.springframework.data.redis.connection.RedisConnection;\nimport&nbsp;org.springframework.data.redis.core.RedisCallback;\nimport&nbsp;org.springframework.data.redis.core.RedisTemplate;\nimport&nbsp;java.io.Serializable;\n/**\n&nbsp;*&nbsp;Cache接口实现类\n&nbsp;*\n&nbsp;*&nbsp;　Spring对于缓存只是提供了抽象的接口，并且通过接口来调用功能，没有具体的实现类，所以需要我们自己实现具体的操作。\n&nbsp;　　在上面配置中可知，每个实现类都会注入一个redisTemplate实例，我们就可以通过redisTemplate来操作redis\n&nbsp;*&nbsp;@author&nbsp;songshuiyang\n&nbsp;*&nbsp;@date&nbsp;2018/4/9&nbsp;20:38\n&nbsp;*/\npublic&nbsp;class&nbsp;RedisCache&nbsp;implements&nbsp;Cache&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;private&nbsp;Logger&nbsp;logger&nbsp;=&nbsp;LoggerFactory.getLogger(this.getClass());\n&nbsp;&nbsp;&nbsp;&nbsp;private&nbsp;RedisTemplate&lt;String,&nbsp;Object&gt;&nbsp;redisTemplate;\n&nbsp;&nbsp;&nbsp;&nbsp;private&nbsp;String&nbsp;name;\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;void&nbsp;clear()&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;logger.info(&quot;----------------------------RedisCache&nbsp;&nbsp;緩存清理-------------------------&quot;);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;redisTemplate.execute(new&nbsp;RedisCallback&lt;String&gt;()&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;String&nbsp;doInRedis(RedisConnection&nbsp;connection)&nbsp;throws&nbsp;DataAccessException&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;connection.flushDb();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;&quot;ok&quot;;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;});\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;void&nbsp;evict(Object&nbsp;key)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;logger.info(&quot;----------------------------RedisCache&nbsp;&nbsp;緩存刪除-------------------------&quot;);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;final&nbsp;String&nbsp;keyf=key.toString();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;redisTemplate.execute(new&nbsp;RedisCallback&lt;Long&gt;()&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;Long&nbsp;doInRedis(RedisConnection&nbsp;connection)&nbsp;throws&nbsp;DataAccessException&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;connection.del(keyf.getBytes());\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;});\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;ValueWrapper&nbsp;get(Object&nbsp;key)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;logger.info(&quot;----------------------------RedisCache&nbsp;&nbsp;缓存获取-------------------------&quot;);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;final&nbsp;String&nbsp;keyf&nbsp;=&nbsp;key.toString();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Object&nbsp;object&nbsp;=&nbsp;null;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;object&nbsp;=&nbsp;redisTemplate.execute(new&nbsp;RedisCallback&lt;Object&gt;()&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;Object&nbsp;doInRedis(RedisConnection&nbsp;connection)&nbsp;throws&nbsp;DataAccessException&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;byte[]&nbsp;key&nbsp;=&nbsp;keyf.getBytes();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;byte[]&nbsp;value&nbsp;=&nbsp;connection.get(key);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(value&nbsp;==&nbsp;null)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;logger.info(&quot;----------------------------RedisCache&nbsp;缓存不存在-------------------------&quot;);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;null;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;SerializationUtils.deserialize(value);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;});\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;ValueWrapper&nbsp;obj=(object&nbsp;!=&nbsp;null&nbsp;?&nbsp;new&nbsp;SimpleValueWrapper(object)&nbsp;:&nbsp;null);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;logger.info(&quot;----------------------------RedisCache&nbsp;获取到内容-------------------------&quot;);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;&nbsp;obj;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;void&nbsp;put(Object&nbsp;key,&nbsp;Object&nbsp;value)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(&quot;-------加入缓存------&quot;);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(&quot;key----:&quot;+key);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(&quot;key----:&quot;+value);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;final&nbsp;String&nbsp;keyString&nbsp;=&nbsp;key.toString();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;final&nbsp;Object&nbsp;valuef&nbsp;=&nbsp;value;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;final&nbsp;long&nbsp;liveTime&nbsp;=&nbsp;86400;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;redisTemplate.execute(new&nbsp;RedisCallback&lt;Long&gt;()&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;Long&nbsp;doInRedis(RedisConnection&nbsp;connection)&nbsp;throws&nbsp;DataAccessException&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;byte[]&nbsp;keyb&nbsp;=&nbsp;keyString.getBytes();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;byte[]&nbsp;valueb&nbsp;=&nbsp;SerializationUtils.serialize((Serializable)&nbsp;valuef);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;connection.set(keyb,&nbsp;valueb);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(liveTime&nbsp;&gt;&nbsp;0)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;connection.expire(keyb,&nbsp;liveTime);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;1L;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;});\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;&lt;T&gt;&nbsp;T&nbsp;get(Object&nbsp;arg0,&nbsp;Class&lt;T&gt;&nbsp;arg1)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;TODO&nbsp;Auto-generated&nbsp;method&nbsp;stub\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;null;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;String&nbsp;getName()&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;this.name;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;Object&nbsp;getNativeCache()&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;this.redisTemplate;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;ValueWrapper&nbsp;putIfAbsent(Object&nbsp;arg0,&nbsp;Object&nbsp;arg1)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;TODO&nbsp;Auto-generated&nbsp;method&nbsp;stub\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;null;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;RedisTemplate&lt;String,&nbsp;Object&gt;&nbsp;getRedisTemplate()&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;redisTemplate;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;void&nbsp;setRedisTemplate(RedisTemplate&lt;String,&nbsp;Object&gt;&nbsp;redisTemplate)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;this.redisTemplate&nbsp;=&nbsp;redisTemplate;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;void&nbsp;setName(String&nbsp;name)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;this.name&nbsp;=&nbsp;name;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n}</pre><h2>六： 使用 Spring Cache注解来使用缓存了</h2><pre class=\"brush:java;toolbar:false\">表明所修饰的方法是可以缓存的：当第一次调用这个方法时，它的结果会被缓存下来，在缓存的有效时间内，以后访问这个方法都直接返回缓存结果，不再执行方法中的代码段。&nbsp;\n这个注解可以用condition属性来设置条件，如果不满足条件，就不使用缓存能力，直接执行方法。&nbsp;\n可以使用key属性来指定key的生成规则。\n@Cacheable&nbsp;支持如下几个参数：\n&nbsp;&nbsp;value：缓存位置名称，不能为空，如果使用EHCache，就是ehcache.xml中声明的cache的name,&nbsp;指明将值缓存到哪个Cache中\n&nbsp;&nbsp;key：缓存的key，默认为空，既表示使用方法的参数类型及参数值作为key，支持SpEL，如果要引用参数值使用井号加参数名，如：#userId，\n&nbsp;&nbsp;一般来说，我们的更新操作只需要刷新缓存中某一个值，所以定义缓存的key值的方式就很重要，最好是能够唯一，因为这样可以准确的清除掉特定的缓存，而不会影响到其它缓存值&nbsp;，&nbsp;\n&nbsp;&nbsp;本例子中使用实体加冒号再加ID组合成键的名称，如”user:1”、”order:223123”等\n&nbsp;&nbsp;condition：触发条件，只有满足条件的情况才会加入缓存，默认为空，既表示全部都加入缓存，支持SpEL\n&nbsp;&nbsp;\n&nbsp;&nbsp;\n&nbsp;&nbsp;//&nbsp;将缓存保存到名称为UserCache中，键为&quot;user:&quot;字符串加上userId值，如&nbsp;&#39;user:1&#39;\n&nbsp;&nbsp;@Cacheable(value=&quot;UserCache&quot;,&nbsp;key=&quot;&#39;user:&#39;&nbsp;+&nbsp;#userId&quot;)&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;public&nbsp;User&nbsp;findById(String&nbsp;userId)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;(User)&nbsp;new&nbsp;User(&quot;1&quot;,&nbsp;&quot;mengdee&quot;);&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;}&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;\n&nbsp;&nbsp;//&nbsp;将缓存保存进UserCache中，并当参数userId的长度小于12时才保存进缓存，默认使用参数值及类型作为缓存的key\n&nbsp;&nbsp;//&nbsp;保存缓存需要指定key，value，&nbsp;value的数据类型，不指定key默认和参数名一样如：&quot;1&quot;\n&nbsp;&nbsp;@Cacheable(value=&quot;UserCache&quot;,&nbsp;condition=&quot;#userId.length()&nbsp;&lt;&nbsp;12&quot;)&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;public&nbsp;boolean&nbsp;isReserved(String&nbsp;userId)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(&quot;UserCache:&quot;+userId);&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;false;&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;}\n&nbsp;&nbsp;\n&nbsp;&nbsp;\n与@Cacheable功能相反，@CacheEvict表明所修饰的方法是用来删除失效或无用的缓存数据。\n@CacheEvict&nbsp;支持如下几个参数：\n&nbsp;&nbsp;value：缓存位置名称，不能为空，同上\n&nbsp;&nbsp;key：缓存的key，默认为空，同上\n&nbsp;&nbsp;condition：触发条件，只有满足条件的情况才会清除缓存，默认为空，支持SpEL\n&nbsp;&nbsp;allEntries：true表示清除value中的全部缓存，默认为false\n&nbsp;&nbsp;//清除掉UserCache中某个指定key的缓存&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;@CacheEvict(value=&quot;UserCache&quot;,key=&quot;&#39;user:&#39;&nbsp;+&nbsp;#userId&quot;)&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;public&nbsp;void&nbsp;removeUser(User&nbsp;user)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(&quot;UserCache&quot;+user.getUserId());&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;}&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;\n&nbsp;&nbsp;//清除掉UserCache中全部的缓存&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;@CacheEvict(value=&quot;UserCache&quot;,&nbsp;allEntries=true)&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;public&nbsp;final&nbsp;void&nbsp;setReservedUsers(String[]&nbsp;reservedUsers)&nbsp;{&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;System.out.println(&quot;UserCache&nbsp;deleteall&quot;);&nbsp;&nbsp;&nbsp;&nbsp;\n&nbsp;&nbsp;}</pre><h3><br/></h3>', '', '缓存', '1', '25', '154', '17', '8', '0', '2018-04-22 21:54:56', 'admin', '2018-08-24 19:27:54', 'admin', '', '1', '');
INSERT INTO `blog_articles` VALUES ('57', 'Spring mvc 前后台传值中文乱码问题 ', '使用 SpringMVC 框架时，如果 HTTP 请求资源返回的是中文字符串，则会出现乱码。原因如下：SpringMVC 框架可以使用 @RequestBody 和 @ResponseBody 两个注解，分别完成请求到对象和对象到响应的转换，底层这种灵活的响应机制，就是Spring3.X 新引入的 HttpMessageConverter 即消息转换器机制。该机制默认的编码为 ISO-8859-1', 'http://111.230.226.158/uploadfile/20180606/004803-220340-spring.jpg', '<h3>一： 解决GET请求参数到了后台中文乱码问题</h3><p><br/></p><p>方式一: 修改tomcat配置, 暂时做法，没有找到更好的解决办法，换了tomcat了又要重新配置</p><pre class=\"brush:xml;toolbar:false\">把tomcat下，server.xml下，添加如下配置，就解决了．\n&lt;Connector&nbsp;connectionTimeout=&quot;20000&quot;&nbsp;port=&quot;8080&quot;&nbsp;protocol=&quot;HTTP/1.1&quot;&nbsp;redirectPort=&quot;8443&quot;&nbsp;URIEncoding=&quot;UTF-8&quot;/&gt;</pre><p><br/></p><p><br/></p><p>方式二: 自定义filter, 解决了get请求中文参数问题，但post请求参数到了后台就gg了</p><pre class=\"brush:java;toolbar:false\">package&nbsp;com.ecut.core.web.filter;\nimport&nbsp;org.springframework.cglib.proxy.InvocationHandler;\nimport&nbsp;org.springframework.cglib.proxy.Proxy;\nimport&nbsp;org.springframework.web.filter.OncePerRequestFilter;\nimport&nbsp;javax.servlet.FilterChain;\nimport&nbsp;javax.servlet.ServletException;\nimport&nbsp;javax.servlet.http.HttpServletRequest;\nimport&nbsp;javax.servlet.http.HttpServletResponse;\nimport&nbsp;java.io.IOException;\nimport&nbsp;java.io.UnsupportedEncodingException;\nimport&nbsp;java.lang.reflect.Method;\npublic&nbsp;class&nbsp;CustomEncodingFilter&nbsp;extends&nbsp;OncePerRequestFilter&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;private&nbsp;String&nbsp;encoding;\n&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;void&nbsp;setEncoding(String&nbsp;encoding)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;this.encoding&nbsp;=&nbsp;encoding;\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;protected&nbsp;void&nbsp;doFilterInternal(HttpServletRequest&nbsp;request,&nbsp;HttpServletResponse&nbsp;response,&nbsp;FilterChain&nbsp;chain)\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;throws&nbsp;ServletException,&nbsp;IOException&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;设置请求响应字符编码\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;request.setCharacterEncoding(encoding);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;response.setCharacterEncoding(encoding);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;//&nbsp;传递给目标servlet或jsp的实际上是动态代理的对象，而不是原始的HttpServletRequest对象\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;request&nbsp;=&nbsp;(HttpServletRequest)&nbsp;Proxy.newProxyInstance(request.getClass().getClassLoader(),&nbsp;request.getClass().getInterfaces(),&nbsp;new&nbsp;MyInvacationHandler(request));\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;chain.doFilter(request,&nbsp;response);\n&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;class&nbsp;MyInvacationHandler&nbsp;implements&nbsp;InvocationHandler&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;private&nbsp;HttpServletRequest&nbsp;request;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;MyInvacationHandler(HttpServletRequest&nbsp;request){\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;this.request=request;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;@Override\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;public&nbsp;Object&nbsp;invoke(Object&nbsp;proxy,&nbsp;Method&nbsp;method,&nbsp;Object[]&nbsp;args)&nbsp;throws&nbsp;Throwable&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;switch&nbsp;(method.getName())&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;case&nbsp;&quot;getParameter&quot;:\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;String&nbsp;value&nbsp;=&nbsp;request.getParameter((String)args[0]);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;try&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if(value&nbsp;!=&nbsp;null){\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;value=new&nbsp;String(value.getBytes(&quot;ISO-8859-1&quot;),encoding);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;catch&nbsp;(UnsupportedEncodingException&nbsp;e)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;e.printStackTrace();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;value;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;case&nbsp;&quot;getParameterValues&quot;:\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;String[]&nbsp;values&nbsp;=&nbsp;request.getParameterValues((String)args[0]);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;if&nbsp;(values&nbsp;!=&nbsp;null)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;for&nbsp;(int&nbsp;i&nbsp;=&nbsp;0;&nbsp;i&nbsp;&lt;&nbsp;values.length;&nbsp;i++)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;try&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;values[i]&nbsp;=&nbsp;new&nbsp;String(values[i].getBytes(&quot;ISO-8859-1&quot;),encoding);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}&nbsp;catch&nbsp;(UnsupportedEncodingException&nbsp;e)&nbsp;{\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;e.printStackTrace();\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;values;\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;default:\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;return&nbsp;method.invoke(request,&nbsp;args);\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;}\n&nbsp;&nbsp;&nbsp;&nbsp;}\n}</pre><p>配置<code>web.xml</code></p><pre class=\"brush:xml;toolbar:false\">&lt;filter&gt;\n&nbsp;&nbsp;&lt;filter-name&gt;encodingFilter&lt;/filter-name&gt;\n&nbsp;&nbsp;&lt;filter-class&gt;com.ecut.core.web.filter.CharacterEncodingFilter&lt;/filter-class&gt;\n&nbsp;&nbsp;&lt;async-supported&gt;true&lt;/async-supported&gt;\n&nbsp;&nbsp;&lt;init-param&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;param-name&gt;encoding&lt;/param-name&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;param-value&gt;UTF-8&lt;/param-value&gt;\n&nbsp;&nbsp;&lt;/init-param&gt;\n&nbsp;&nbsp;&lt;init-param&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;param-name&gt;forceEncoding&lt;/param-name&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;param-value&gt;true&lt;/param-value&gt;\n&nbsp;&nbsp;&lt;/init-param&gt;\n&lt;/filter&gt;\n&lt;filter-mapping&gt;\n&nbsp;&nbsp;&lt;filter-name&gt;encodingFilter&lt;/filter-name&gt;\n&nbsp;&nbsp;&lt;url-pattern&gt;/*&lt;/url-pattern&gt;\n&lt;/filter-mapping&gt;</pre><p><br/></p><h3>二： 解决POST请求参数到了后台中文乱码问题</h3><pre class=\"brush:xml;toolbar:false;\">&lt;filter&gt;\n&nbsp;&nbsp;&lt;filter-name&gt;encodingFilter&lt;/filter-name&gt;\n&nbsp;&nbsp;&lt;filter-class&gt;org.springframework.web.filter.CharacterEncodingFilter&lt;/filter-class&gt;\n&nbsp;&nbsp;&lt;async-supported&gt;true&lt;/async-supported&gt;\n&nbsp;&nbsp;&lt;init-param&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;param-name&gt;encoding&lt;/param-name&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;param-value&gt;UTF-8&lt;/param-value&gt;\n&nbsp;&nbsp;&lt;/init-param&gt;\n&nbsp;&nbsp;&lt;init-param&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;param-name&gt;forceEncoding&lt;/param-name&gt;\n&nbsp;&nbsp;&nbsp;&nbsp;&lt;param-value&gt;true&lt;/param-value&gt;\n&nbsp;&nbsp;&lt;/init-param&gt;\n&lt;/filter&gt;\n&lt;filter-mapping&gt;\n&nbsp;&nbsp;&lt;filter-name&gt;encodingFilter&lt;/filter-name&gt;\n&nbsp;&nbsp;&lt;url-pattern&gt;/*&lt;/url-pattern&gt;\n&lt;/filter-mapping&gt;</pre><p><br/></p>', '', '框架', '0', '25,31,32', '159', '35', '9', '2', '2018-04-22 22:02:38', 'admin', '2018-08-24 19:28:06', 'admin', '', '1', '');
